import React from 'react';
import GoogleMapReact from 'google-map-react';
import { useState } from 'react';
import { useEffect } from 'react';
import api from '../../api';

import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';



const CustomMarker = ({ text, onMarkerClicked }) => (
  <div style={{
    color: 'white',
    background: 'grey',
    padding: '15px 10px',
    display: 'inline-flex',
    textAlign: 'center',
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: '100%',
    transform: 'translate(-50%, -50%)'
  }} onClick={onMarkerClicked}>
    {text}
  </div>
);





const Map = () => {
  const [parkings, setParkings] = useState(null)
  const [open, setOpen] = React.useState(false);


  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };


  function onLoad(){
    api.get("/getParkings", {withCredentials: true})
    .then(res=>{
      setParkings(res.data);
      console.log(res.data);
    })
    .catch(err=>{
      console.log(err);
    })
  }
  
  useEffect(() => {
    onLoad();
  }, [])

  return (
    <div style={{ height: '100vh', width: '100%' }}>
      <GoogleMapReact
        bootstrapURLKeys={{ key: 'AIzaSyDRA8KWu6hfAC7vyYG8h4FQ48UzNymOjUc' }}
        defaultCenter={{ lat: 18.622761, lng:  73.741953 }}
        defaultZoom={13}
      >
        {parkings?.map((parking)=>{
          return (
          <>
            <CustomMarker lat={parking.plat} lng={parking.plng} text={parking.pname} 
              onMarkerClicked={handleClickOpen} />
            <Dialog
              open={open}
              onClose={handleClose}
              aria-labelledby="alert-dialog-title"
              aria-describedby="alert-dialog-description"
            >
              <DialogTitle id="alert-dialog-title">
                {parking.pname}
              </DialogTitle>
              <DialogContent>
                <DialogContentText id="alert-dialog-description">
                  {parking.pname}
                </DialogContentText>
              </DialogContent>
              <DialogActions>
                <Button onClick={handleClose}>Back</Button>
                <Button onClick={handleClose} autoFocus>
                  Select
                </Button>
              </DialogActions>
            </Dialog>
            </>
            );
        })}
        
      </GoogleMapReact>
    </div>
  );
};

export default Map;
